import React from 'react';
import './instructions.css';
import star from './star.svg';

//import 

class Instructions extends React.Component{

    render(){
        return (
            <div className="title-row">
                <img src="./star.svg" />
                <p className="instructions-title">Instructions</p>
                <img src="./star.svg" />
                <table className="instructions-row">
                <tr>
                    <td className="instructions-number">1</td>
                    <td className="instructions-text">Hiding behind one of these doors is the ChoreBot.</td>
                </tr>
                <tr>
                    <td className="instructions-number">2</td>
                    <td className="instructions-text">Your mission is to open all of the doors without running into the ChoreBot.</td>
                </tr>
                <tr>
                    <td className="instructions-number">3</td>
                    <td className="instructions-text">If you manage to avoid the ChoreBot until you open the very last door, you win!</td>
                </tr>
                <tr>
                    <td className="instructions-number">4</td>
                    <td className="instructions-text">See if you can score a winning streak!</td>
                </tr>
            </table>
            </div>
        );
    }
}

export default Instructions;
